/*
1044. Longest Duplicate Substring
Hard
link: https://leetcode.com/problems/longest-duplicate-substring/

Given a string s, consider all duplicated substrings: (contiguous) substrings of s that occur 2 or more times. The occurrences may overlap.

Return any duplicated substring that has the longest possible length. If s does not have a duplicated substring, the answer is "".



Example 1:

Input: s = "banana"
Output: "ana"

Example 2:

Input: s = "abcd"
Output: ""



Constraints:

    2 <= s.length <= 3 * 104
    s consists of lowercase English letters.

===============================Solution===========================
a	b	c	e	b	c	d	f
b	x	0	0	1	0	0	0
c		x	0	0	2	0	0
e			x	0	0	0	0
b				x	0	0	0
c					x	0	0
d						x	0
f							x


* * */


public class H_1044longestDuplicateString_naiveSuffixString {

    public static String longestDupSubstring(String s) {
        int sLen = s.length();
        int maxDup = 0;
        int maxLoc = -1;

        int dupLen = 0;
        int dupLoc = -1;
        //1. start point of walking
        for (int l = sLen - 1; l > 0; l--) {
//        for (int l = 1; l <sLen; l++) {
            if (sLen - l > maxDup) {

                dupLen = 0;
                dupLoc = -1;
                for (int i = 0, j = l; i < sLen && j < sLen; i++, j++) {
                    if (s.charAt(i) == s.charAt(j)) {
                        dupLen++;
                        dupLoc = j;
                    }else {
                        dupLen = 0;
                        dupLoc = -1;
                    }

                    if (maxDup < dupLen) {
                        maxDup = dupLen;
                        maxLoc = dupLoc;
                    }
                }
            }

        }
//        System.out.println(maxLoc + " | " +maxDup);
        return s.substring(maxLoc - maxDup + 1, maxLoc + 1);
    }


    public static void main(String[] args) {
        long milliStart = System.currentTimeMillis();

        System.out.println(longestDupSubstring("aa"));
        System.out.println(longestDupSubstring("banana"));
        System.out.println(longestDupSubstring("Dynamic Programming can solve many problems, but that does not mean there isnâ€™t a more efficient solution out there. Solving a problem with Dynamic Programming feels like magic, but remember that dynamic programming is merely a clever brute force. Sometimes it pays off well, and sometimes it helps only a little."));
        System.out.println(longestDupSubstring(""));

        System.out.println("Time used in milli: " + (System.currentTimeMillis() - milliStart));
    }
}
